(1, '60f66193cd8cb', NULL, 'Advanced WooCommerce Support', 'We have detected you are running WooCommerce. Upgrade to AIOSEO Pro to unlock our advanced eCommerce SEO features, including SEO for Product Categories and more.', 'info', '[\"all\"]', NULL, 'woo-upsell', '2021-07-20 05:39:31', NULL, 'Upgrade to Pro', 'http://www.shareasale.com/r.cfm?B=1491200&U=1258907&M=94778&urllink=https%3A%2F%2Faioseo.com%2Flite-upgrade%2F%3Futm_source%3DWordPress%26%23038%3Butm_campaign%3Dliteplugin%26%23038%3Butm_medium%3Dwoo-notification-upsell', NULL, NULL, 1, 0, '2021-07-20 05:39:31', '2021-07-25 09:47:21'),
(2, '6102732886b12', NULL, '🎉 Introducing Full Site Redirects + Headline Analyzer', 'Now easily redirect your ENTIRE website to another domain. No need to hire a developer!\r\n<br /><br />\r\nPlus, with our brand new Headline Analyzer, you can write catchy headlines that users can\'t help but click.\r\n<br /><br />\r\nTo get full access to our Pro features, upgrade your license today and save 50% OFF.', 'success', '[\"4-x\",\"lite\"]', 76, NULL, '2021-07-28 11:37:03', NULL, 'Learn More', 'https://aioseo.com/introducing-the-new-aioseo-full-site-redirect-and-headline-analyzer/?utm_source=WordPress&utm_campaign=introducing-the-new-aioseo-full-site-redirect-and-headline-analyzer-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=introducing-the-new-aioseo-full-site-redirect-and-headline-analyzer-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 1, 0, '2021-07-29 09:21:44', '2021-11-20 00:01:20'),
(3, '61158d177a7a3', NULL, '📢 Announcing HTML Sitemaps: Help Visitors Find Your Content Faster', 'Help your visitors to discover the posts, pages, and products they’re looking for.\r\n<br /><br />\r\nPlus, help improve your rankings by making your website user-friendly and easy to crawl.\r\n<br /><br />\r\nTo get full access to our Pro features, upgrade your license today and save 50% OFF. 😍', 'success', '[\"4-x\",\"lite\"]', 86, NULL, '2021-07-28 11:36:58', NULL, 'Learn More', 'https://aioseo.com/introducing-html-sitemaps/?utm_source=WordPress&utm_campaign=introducing-html-sitemaps-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=introducing-html-sitemaps-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 1, 0, '2021-08-12 21:05:27', '2021-11-20 00:01:20'),
(4, '6139d00305d5f', NULL, '📣 Introducing Local SEO Map Embeds!', 'Now it\'s easy to add multiple locations and embed a custom Google Map on your website!\r\n<br /><br />\r\nEnter your address or drop a pin on your precise location, then choose from 4 different map styles.\r\n<br /><br />\r\nPlus, get access to SEO pro tips in your editor sidebar so you can make sure each post is fully optimized.\r\n<br /><br />\r\nTo get full access to our Pro features, upgrade your license today and save 50% OFF.', 'success', '[\"4-x\",\"lite\"]', 92, NULL, '2021-09-07 00:00:00', NULL, 'Learn More', 'https://aioseo.com/announcing-local-seo-map-embeds/?utm_source=WordPress&utm_campaign=introducing-local-seo-maps-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=introducing-local-seo-maps-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 1, 0, '2021-09-09 09:12:35', '2021-11-20 00:01:21'),
(5, '619719d1788bc', NULL, '📢 Introducing Our Updated Redirect Testing Tool + Enhancements to Sitemaps', 'Check out our completely revamped <strong>Redirect Testing tool</strong>! Now, you can easily test URL redirect right within your WordPress dashboard and see the status code with a single click.\r\n<br><br>\r\n<img style=\"width:100%;max-width:400px\" src=\"data:image/png;base64,\" />\r\n<br><br>\r\nWe\'ve also added a number of improvements to sitemaps, including the last generated date and a custom 404 page.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.5 today and take advantage of these enhancements!', 'info', '[\"4-x\",\"lite\"]', 110, NULL, '2022-01-19 20:15:04', NULL, 'Learn More', 'https://aioseo.com/introducing-our-redirect-testing-tool-new-enhancements-to-our-sitemaps/?utm_source=WordPress&utm_campaign=redirects-testing-tool-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=redirects-testing-tool-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 1, 0, '2021-11-19 03:28:17', '2022-01-20 10:45:19'),
(6, '619f3e570b3a3', NULL, '🔥 Save 65% OFF AIOSEO - Limited Time Black Friday Sale!', 'This Black Friday, we’re offering an incredible discount, up to <strong><em>65% OFF</em></strong> on AIOSEO!\r\n<br><br>\r\n<strong>This is the biggest sale we have <em>EVER</em> had, and it\'s available RIGHT NOW!</strong>\r\n<br><br>\r\nIf you’ve been thinking about becoming part of the AIOSEO Pro family, now’s the perfect time, but you’ll have to act fast since this remarkable deal expires soon!', 'success', '[\"4-x\",\"lite\"]', 165, NULL, '2021-11-23 18:42:05', '2021-11-27 00:00:00', 'Upgrade AIOSEO NOW! (65% OFF)', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=black-friday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade AIOSEO NOW', 'Learn More', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=black-friday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 0, 0, '2021-11-25 07:42:15', '2021-11-26 09:29:54'),
(7, '61a375b466726', NULL, '🌳 Get AIOSEO Pro (65% OFF Today) + Donate for a Cause 🌳', 'Want to boost your SEO rankings while giving back something in return?\r\n<br><br>\r\nThis Green Monday, we’re offering <strong><em>up to 65% OFF</em></strong> on AIOSEO Pro purchases.\r\n<br><br>\r\nAnd a portion of sales will be donated to The Conservation Fund, a non-profit that protects America\'s legacy of land and water resources through land acquisition and more.', 'success', '[\"4-x\",\"lite\"]', 183, NULL, '2021-12-13 00:00:00', '2021-12-14 00:00:00', 'Upgrade AIOSEO NOW! (65% OFF)', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=green-monday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade AIOSEO NOW', NULL, NULL, 0, 0, '2021-11-28 12:27:32', '2021-12-13 07:09:50'),
(8, '61a375b469aae', NULL, '⌛ Cyber Monday Sale is Ending Soon!', 'This Cyber Monday sale is your last chance to grab the world’s best SEO plugin for the best price.\r\n<br><br>\r\n<strong><em>This is the biggest sale we have EVER had, and it\'s available RIGHT NOW!</em></strong>\r\n<br><br>\r\nIf you want to step up your SEO game in 2022, then you need AIOSEO Pro, and NOW is the best time to get it!', 'success', '[\"4-x\",\"lite\"]', 176, NULL, '2021-11-29 00:00:00', '2021-12-04 00:00:00', 'Upgrade AIOSEO NOW! (65% OFF)', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=cyber-monday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade AIOSEO NOW', 'Learn More', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=cyber-monday-2021-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 0, 0, '2021-11-28 12:27:32', '2021-12-03 21:03:56'),
(9, '61eb388404be0', NULL, '📢 Introducing Link Assistant + Our Stand-Alone Headline Analyzer', 'Check out the brand new features in AIOSEO 4.1.6! First, we have Link Assistant, a powerful tool to help you build effective internal links and audit external ones.\r\n<br><br>\r\nWe’ve also added a stand-alone Headline Analyzer to help you craft, and A/B test your headlines right from within WordPress.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.6 today and up your SEO game without breaking a sweat!', 'success', '[\"4-x\",\"lite\"]', 203, NULL, '2022-02-08 13:39:00', NULL, 'Learn More', 'https://aioseo.com/new-introducing-link-assistant-a-stand-alone-headline-analyzer-and-more-in-aioseo-4-1-6/?utm_source=WordPress&utm_campaign=link-assistant-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=link-assistant-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-01-21 22:49:40', '2022-03-01 06:52:27'),
(10, '6202f7dc5bfd5', NULL, '🎉 Introducing IndexNow and Page Builder Integrations', 'Check out the fantastic new features in AIOSEO 4.1.7! First, we have IndexNow, a feature that gets your new or updated content indexed faster on Bing and Yandex (with more search engines to follow).\r\n<br><br>\r\nWe’ve also integrated AIOSEO with 3 major page builders, namely Elementor, Divi and SeedProd. Now you can work on your SEO right from within your page builder.\r\n<br><br>\r\nGet AIOSEO Pro today and up your SEO game without breaking a sweat!', 'success', '[\"4-x\",\"lite\"]', 223, NULL, '2022-03-01 16:19:06', NULL, 'Learn More', 'https://aioseo.com/introducing-indexnow-and-page-builder-integrations-in-aioseo-4-1-7/?utm_source=WordPress&utm_campaign=index-now-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=index-now-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-02-08 23:08:12', '2022-03-28 18:43:50'),
(11, '621f14e48d1b5', NULL, '📢 Announcing 4.1.8: Improved Site Redirects and Modified Date for Posts 📢', 'Redirects have never been easier! Our 4.1.8 update comes with a powerful feature that enables you to implement a redirect from right within a post.\r\n<br><br>\r\nWe’ve also added a \"limit modified date\" feature that allows you to make minor edits to posts/pages and keep the date the same.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.8 today and enjoy these 2 powerful features and more.', 'success', '[\"4-x\",\"lite\"]', 241, NULL, '2022-04-08 19:59:50', NULL, 'Learn More', 'https://aioseo.com/announcing-improved-site-redirects-and-modified-date-for-posts/?utm_source=WordPress&utm_campaign=introducing-on-page-redirects-and-limit-modified-date-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=introducing-on-page-redirects-and-limit-modified-date-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-03-02 06:55:32', '2022-04-26 05:49:33'),
(12, '62435953dfd27', NULL, 'Microsoft Clarity Integration and a New REST API Addon 🎉🎉', 'Now you can see how your website visitors interact with your web pages with heatmaps and session recordings, thanks to Microsoft Clarity.\r\n<br><br>\r\nWe’ve also added a REST API addon to make SEO easier for your headless website.\r\n<br><br>\r\nUpdate to AIOSEO 4.1.9 today and enjoy these 2 powerful features on your website!', 'success', '[\"4-x\",\"lite\"]', 263, NULL, '2022-05-03 15:26:42', NULL, 'Learn More', 'https://aioseo.com/introducing-the-new-microsoft-clarity-integration-and-rest-api-addon/?utm_source=WordPress&utm_campaign=microsoft-clarity-rest-api-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=microsoft-clarity-rest-api-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-03-29 19:09:07', '2022-05-30 08:00:45'),
(13, '6251e487c37be', NULL, '📢 🌿 Sale! Sale! Sale! 🌿 📢', '<img src=\"data:image/png;base64,\" />\r\n<br><br>\r\nOur spring sale is on! Get up to <strong>65% off</strong> our plans and save big.\r\n<br><br>\r\nHurry, this offer is only valid through Monday!', 'success', '[\"4-x\",\"lite\"]', 282, NULL, '2022-04-08 19:59:50', '2022-04-12 00:00:00', 'Get AIOSEO Pro NOW! (65% OFF)', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=spring-sale-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro NOW!', NULL, NULL, 0, 0, '2022-04-09 19:54:47', '2022-04-10 21:31:11'),
(14, '626a2be29ed58', NULL, '📢 Introducing 2 New Features! — Dashboard Widgets And Shorter URLs 📢', 'We’ve added 2 new dashboard widgets. One to help you set up your website for better SEO and the other to show you an overview of how optimized your posts are.\r\n<br><br>\r\nAnother feature you’ll love is the Strip Category Base Prefix feature that enables you to create shorter URLs by removing the category base.\r\n<br><br>\r\nUpgrade to AIOSEO 4.2.0 Pro today and enjoy these powerful features on your website!!', 'success', '[\"4-x\",\"lite\"]', 308, NULL, '2022-05-31 21:15:05', NULL, 'Learn More', 'https://aioseo.com/new-dashboard-widgets-and-strip-category-base-feature/?utm_source=WordPress&utm_campaign=dashboard-widgets-strip-category-base-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=dashboard-widgets-strip-category-base-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-04-28 05:53:38', '2022-06-20 18:52:09'),
(15, '62721470a8edf', NULL, '👉 Awesome Motive Just Hit 20 MILLION Websites Using our Software!', 'We\'ve got some exciting news to share!\r\n<br><br>\r\nAwesome Motive (our parent company) just hit the <strong>20 MILLION</strong> website milestone. 🤯\r\n<br><br>\r\nTo celebrate, we’re offering you up to 65% off our paid plans for <strong>only the next 2 days</strong>! 🎉\r\n', 'success', '[\"4-x\",\"lite\"]', 312, NULL, '2022-05-03 15:26:42', '2022-05-06 00:00:00', 'Get AIOSEO Pro NOW!', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=20-million-v4-lite&utm_medium=plugin-notification&utm_content=🚀 Get AIOSEO Pro NOW!', NULL, NULL, 0, 0, '2022-05-04 05:51:44', '2022-05-04 05:51:44'),
(16, '6296cbcce92c7', NULL, '📣 Introducing Crawl Cleanup and Import URLs to Your Sitemap!', 'AIOSEO 4.2.1 now allows you to manage Search Engine crawl quota by removing query args (URL parameters) from selected URLs and disabling unnecessary RSS feeds.\r\n<br><br>\r\nYou can also import bulk URLs from a CSV file to add more pages to your sitemap.\r\n<br><br>\r\nUpdate to AIOSEO 4.2.1 to take advantage of these powerful SEO features today!', 'success', '[\"4-x\",\"lite\"]', 327, NULL, '2022-07-19 14:22:11', NULL, 'Learn More', 'https://aioseo.com/introducing-crawl-cleanup-and-importing-urls-from-a-csv-file-to-your-sitemap/?utm_source=WordPress&utm_campaign=crawl-cleanup-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/pricing/?utm_source=WordPress&utm_campaign=crawl-cleanup-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 0, '2022-06-01 02:15:40', '2022-07-25 07:20:09'),
(17, '62b22e608e901', NULL, 'AIOSEO 4.2.2 is HERE with some great new features! 🎉', 'Connect your WordPress user profile directly to your social media accounts for improved SEO.\r\n<br><br>\r\nOur new Translations API enables third-party translation apps to hook into AIOSEO’s data for multilingual SEO.\r\n<br><br>\r\nUpdate to AIOSEO 4.2.2 now and enjoy more SEO opportunities!', 'success', '[\"4-x\",\"lite\"]', 338, NULL, '2022-07-19 14:22:11', NULL, 'Learn More', 'https://aioseo.com/announcing-our-new-user-social-profile-tab-and-translation-api-in-aioseo-4-2-2/?utm_source=WordPress&utm_campaign=social-profiles-translations-api-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=social-profiles-translations-api-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-06-21 20:47:28', '2022-07-25 07:20:09');
