(20, '62d7a0f32dc99', NULL, '📣 AIOSEO 4.2.3: Introducing FAQ and Table of Contents blocks + URL Slug Monitor.', 'You can now add <strong>FAQ and Table of Contents blocks</strong> to increase your visibility on SERPs and improve user experience.\r\n<br><br>\r\nAnd our <strong>URL Slug Monitor</strong> is a powerful addition that checks for changes in your URLs and prompts you to add redirects which helps <strong>prevents 404 errors</strong> on your site.\r\n<br><br>\r\nUpdate to 4.2.3 today and check out these powerful new features!', 'success', '[\"4-x\",\"lite\"]', 414, NULL, '2022-08-16 12:14:02', NULL, 'Learn More', 'https://aioseo.com/introducing-aioseo-4-2-3-faq-and-table-of-contents-blocks-all-new-url-slug-monitor/?utm_source=WordPress&utm_campaign=introducing-faq-toc-blocks-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=introducing-faq-toc-blocks-vv-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-07-20 06:30:11', '2022-09-13 06:09:13'),
(21, '62dfa5119477b', NULL, 'We\'re celebrating 100 million downloads of AIOSEO!!! 🥳', 'And we want to share this HUGE milestone with you by <strong>slashing our prices</strong>.\r\n<br><br>\r\nWe\'re offering up to <strong>65% off</strong> our paid plans until July 28.\r\n<br><br>\r\nGrab it while the party lasts! (<strong>Hurry! This offer won\'t last long!</strong>) 🎉\r\n', 'success', '[\"4-x\",\"lite\"]', 417, NULL, '2022-07-25 15:21:38', '2022-07-28 00:00:00', 'Get AIOSEO Pro NOW! (65% OFF)', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=100m-downloads-sale-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro%20NOW!%20(65%%20OFF)', NULL, NULL, 0, 0, '2022-07-26 08:25:53', '2022-07-27 11:59:44'),
(22, '62dfa5119b45a', NULL, 'LAST CHANCE: We\'re celebrating 100 million downloads of AIOSEO!!! ⌛', 'AIOSEO just hit <strong>100 MILLION DOWNLOADS</strong> and we\'ve been celebrating all week with as much as <strong>65% off our paid plans!</strong> 🥳\r\n<br><br>\r\nThe party’s almost over and you’re about to miss out on this amazing celebration deal.\r\n<br><br>\r\nMake sure to grab yours ASAP because it <strong>expires today!</strong> 🎉 🎉', 'success', '[\"4-x\",\"lite\"]', 456, NULL, '2022-07-28 00:00:00', '2022-07-29 00:00:00', 'Get AIOSEO Pro NOW! (65% OFF)', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=100m-downloads-sale-last-chance-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro%20NOW!%20(65%%20OFF)', NULL, NULL, 0, 0, '2022-07-26 08:25:53', '2022-07-27 11:59:44'),
(23, '62fc7e619d24b', NULL, 'AIOSEO just got more powerful with version 4.2.4! 🚀', 'Easily eliminate 404 errors with <strong>automatic redirects</strong> using our massively improved Redirection Manager. \r\n<br><br>\r\nThis update also includes some huge improvements to our Image SEO addon, making it much easier for your content to rank. 📸\r\n<br><br>\r\nUpdate to <strong>AIOSEO 4.2.4</strong> today and take advantage of these powerful new features!', 'success', '[\"4-x\",\"lite\"]', 463, NULL, '2022-09-22 20:05:34', NULL, 'Learn More', 'https://aioseo.com/announcing-aioseo-4-2-4-improved-redirects-and-image-seo-updates/?utm_source=WordPress&utm_campaign=improved-redirects-image-seo-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=improved-redirects-image-seo-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 0, '2022-08-17 05:36:33', '2022-10-09 18:55:30'),
(24, '63216b06965df', NULL, 'The Next-Gen Schema Generator is here! 🎉', 'This is a huge leap forward in WordPress schema implementation, and you definitely want to add it to boost your website SEO! 🚀\r\n<br><br>\r\nWebsites with schema markups enjoy better SEO rankings, higher traffic, and more sales. AIOSEO 4.2.5 makes it possible without touching a single line of code.\r\n<br><br>\r\nUpdate to AIOSEO 4.2.5 <strong>TODAY</strong> and enjoy the power of our <strong>new Schema Generator!</strong>', 'success', '[\"4-x\",\"lite\"]', 492, NULL, '2022-09-13 00:00:00', NULL, 'Learn More', 'https://aioseo.com/announcing-aioseo-4-2-5-next-gen-schema-generator-to-improve-your-seo-rankings/?utm_source=WordPress&utm_campaign=schema-generator-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=schema-generator-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 0, '2022-09-14 05:47:50', '2022-11-07 20:19:01'),
(25, '632e9cb984c2d', NULL, '🍂 Our fall sale is on! 🍂', 'Get up to 70% off AIOSEO Pro to improve your SEO rankings.\r\n<br><br>\r\nThis will get you access to our Next-Gen Schema generator, powerful Link Assistant, and dozens of SEO features to grow your traffic.\r\n<br><br>\r\nUpgrade this week and save BIG!', 'success', '[\"4-x\",\"lite\"]', 503, NULL, '2022-09-22 20:05:34', '2022-09-29 00:00:00', 'Get AIOSEO Pro NOW! (70% OFF)', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=2022-fall-sale-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro NOW! (70% OFF)', NULL, NULL, 0, 0, '2022-09-24 05:59:21', '2022-09-27 19:51:38'),
(26, '6345b94e7d766', NULL, 'The much-awaited SEO emoji picker is here! 🎉', 'Now you can add emojis to SEO fields to get <strong>higher CTRs and engagement on SEO and social media platforms</strong>. 😳\r\n<br><br>\r\nPlus, we’ve also greatly improved our multisite SEO module, making it easy to <strong>manage WordPress multisite SEO from a single dashboard</strong>. ✅\r\n<br><br>\r\nWith AIOSEO 4.2.6, you’ve got more tools to help you rank your content, and that <strong>without touching a single line of code</strong>. 🧑🏽‍💻\r\n<br><br>\r\n<strong>Update to AIOSEO 4.2.6 TODAY</strong> and enjoy the power of our new SEO emoji picker and improved multisite SEO module! 🚀', 'success', '[\"4-x\",\"lite\"]', 512, NULL, '2022-11-28 20:45:42', NULL, 'Learn More', 'https://aioseo.com/announcing-aioseo-4-2-6-new-seo-emoji-picker-multisite-seo-improvements/?utm_source=WordPress&utm_campaign=emoji-picker-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', '🚀 Get AIOSEO Pro NOW!', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=emoji-picker-v4-lite&utm_medium=plugin-notification&utm_content=🚀 Get AIOSEO Pro NOW!', 0, 0, '2022-10-11 18:43:26', '2022-12-05 06:34:14'),
(27, '636ab190d3219', NULL, 'Announcing AIOSEO 4.2.7: Google Merchant Center Schema to help you Boost Visibility and Sales! 🛒💰', 'Do you sell products on your website? We’ve got great news for you!\r\n<br><br>\r\nEnjoy greater visibility and higher CTRs for your products on search engines with our new <strong>Google Merchant Center</strong> Listing schema support. \r\n<br><br>\r\nSo, go ahead and upgrade to <strong>AIOSEO Pro 4.2.7 TODAY</strong> and get more tools to help you rank your content and products!', 'success', '[\"4-x\",\"lite\"]', 526, NULL, '2022-12-06 20:35:55', NULL, 'Learn More', 'https://aioseo.com/announcing-aioseo-4-2-7-drive-more-sales-with-google-merchant-center-listing-schema/?utm_source=WordPress&utm_campaign=google-merchant-center-schema-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=google-merchant-center-schema-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 1, '2022-11-08 19:44:16', '2023-02-07 06:47:03'),
(28, '637c1f3dae69f', NULL, 'Black Friday: HUGE Sale! Get Up to 70% Off AIOSEO 🛍', 'Our biggest sale of the year is now live! Get up to 70% off AIOSEO, the world’s best WordPress SEO plugin. You’ll unlock our NEW Link Assistant addon, redirection manager, local SEO module, image SEO module, news/video sitemaps +more! PLUS enter our giveaway to WIN an Apple 14” M1 PRO Macbook Pro - no purchase necessary!', 'success', '[\"4-x\",\"lite\"]', 534, NULL, '2022-11-24 19:50:33', '2022-11-28 00:00:00', 'Enter Giveaway', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=bf2022-enter-giveaway-v4-lite', 'Claim Your Upgrade Discount', 'https://aioseo.com/black-friday/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=bf2022-claim-your-upgrade-discount-v4-lite', 0, 1, '2022-11-22 01:00:45', '2022-11-27 06:46:56'),
(29, '6390320a32af2', NULL, 'AIOSEO 4.2.8: More Control Over Search and Social Snippets with SEO Preview 🔎', 'Get greater control over how your search and social media snippets appear with our <strong>new SEO Preview tool</strong>.\r\n<br><br>\r\nPlus, check how well you’ve set up your page’s SEO by getting an overview of your meta tags and basic SEO.\r\n<br><br>\r\nSo, <strong>update to AIOSEO 4.2.8 TODAY</strong> and boost your rankings and drive more engagement on SERPs and social media!', 'success', '[\"4-x\",\"lite\"]', 560, NULL, '2023-02-24 16:13:04', NULL, 'Learn More', 'https://aioseo.com/new-seo-preview-more-control-over-search-and-social-snippets/?utm_source=WordPress&utm_campaign=seo-preview-v4-lite&utm_medium=plugin-notification&utm_content=Learn More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=seo-preview-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro', 0, 1, '2022-12-07 06:26:18', '2023-03-09 07:21:27'),
(30, '63e3ac7429272', NULL, 'Introducing SEO Stats for WordPress - Track Your Keyword Rankings and See Important SEO Metrics with 1-click 🔎 🚀', 'Want to see exactly how your content ranks in search results inside of WordPress? You can do just that with our brand new <strong>Google Search Console integration</strong>!\r\n<br><br>\r\nTrack important keywords and get in-plugin tips to help you grow your traffic. <strong>Plus: Try out the new speed test tool!</strong> 🚀\r\n<br><br>\r\n<strong>Upgrade to AIOSEO 4.3.0 (Elite) TODAY to ignite your SEO and outrank competitors!</strong>\r\n<br><br>\r\n<img src=\"data:image/png;base64,\" />', 'success', '[\"4-x\",\"lite\"]', 570, NULL, '2023-06-27 12:55:16', NULL, 'Learn More', 'https://aioseo.com/google-search-console-integration/?utm_source=WordPress&utm_campaign=google-search-console-integration-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Get AIOSEO Pro 🚀', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=google-search-console-integration-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 1, '2023-02-08 14:06:44', '2023-07-03 08:49:48'),
(31, '63f98824a475f', NULL, '❄️ Save up to 70% OFF Link Assistant, Search Statistics and MORE During our Winter Sale! ❄️', 'We’re kicking off our winter sale and you don’t want to miss the hot deals we have. 🔥\r\n<br><br>\r\nIf you act within the next 7 days, you can get AIOSEO <strong>for as much as 70% off</strong> with access to our <strong>Redirection Manager, Link Assistant, Search Statistics and MORE</strong>!\r\n<br><br>\r\nWith all the powerful features we’ll be adding to the plugin this year, getting the plugin at these discounted prices is a steal. <strong>Seriously</strong>.\r\n<br><br>\r\n⚡ So, claim your discount now before it expires! ⚡', 'success', '[\"4-x\",\"lite\"]', 603, NULL, '2023-02-24 16:13:04', '2023-03-02 00:00:00', 'Get AIOSEO Pro Today! (up to 70% OFF)', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=proplugin&utm_medium=Plugin%20Notification&utm_content=winter-sale-2023-get-aioseo-pro-today', NULL, NULL, 0, 1, '2023-02-25 04:01:40', '2023-03-01 06:46:09'),
