(35, '6453f917e814e', NULL, '🗣️ [AIOSEO 4.3.6] Announcing Content Rankings: SEO Performance Tracking Made Easy', 'Get valuable insights about how your content is performing on search engines using our <strong>NEW Content Rankings report</strong>.\r\n<br><br>\r\nThis includes SEO data to help you <strong>optimize your articles for better rankings</strong>. Plus, you can also easily spot <strong>content decay</strong>, making it easier to combat it.\r\n<br><br>\r\nSo, <strong>upgrade to AIOSEO Pro TODAY</strong> and boost your rankings and drive more traffic to your content!', 'success', '[\"4-x\",\"lite\"]', 677, NULL, '2023-06-27 12:55:16', NULL, 'Learn More', 'https://aioseo.com/announcing-content-rankings-seo-performance-tracking-made-easy/?utm_source=WordPress&utm_campaign=content-rankings-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=content-rankings-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 1, '2023-05-04 18:27:35', '2023-07-03 08:49:48'),
(36, '64758fc2697a6', NULL, '[Last Chance!] 🇺🇸 Save up to 70% on AIOSEO during our flash sale! 🧨', 'Did you know today\'s the <span style=\"text-decoration:underline;\">last day</span> to <strong>upgrade</strong> & <strong>save big</strong> on the world\'s best SEO plugin?\r\n<br><br>\r\n⚡ Power up your traffic & sales with our futuristic <strong>AI tools</strong> & <strong>Google Search Console integration</strong>. ⚡\r\n<br><br>\r\nDon’t miss out on these sizzling deals. 💥\r\n<br><br>\r\nClaim your discount before it\'s gone!', 'success', '[\"4-x\",\"lite\"]', 721, NULL, '2023-05-30 00:00:00', '2023-05-31 00:00:00', 'Get AIOSEO Pro Today!', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=v4-lite&utm_medium=Plugin%20Notification&utm_content=memorial-day-sale-last-chance-2023-get-aioseo-pro-today', NULL, NULL, 0, 1, '2023-05-30 05:55:14', '2023-05-30 05:55:14'),
(37, '64758fc26ada1', NULL, '[Memorial Day Sale] 🇺🇸 Get up to 70% off AIOSEO! 💥', 'We just launched our Memorial Day sale! Snag <strong style=\"text-decoration: underline;\"><em>all</em></strong> the SEO features you want to surge traffic and sales. \r\n<ul style=\"list-style: inside;\">\r\n	<li>Save time with our AI <strong>ChatGPT integration</strong>.</li>\r\n	<li>Boost <strong>rankings</strong> with our <strong>Google Search Console integration</strong>.</li>\r\n</ul>\r\nFor only <strong style=\"text-decoration: underline;\">1 day</strong> you can get <strong>giant discounts</strong> on the world\'s best SEO plugin.\r\n<br /><br />\r\n⚡So grab your deal while it lasts! ⚡', 'success', '[\"4-x\",\"lite\"]', 708, NULL, '2023-05-29 13:43:06', NULL, 'Get AIOSEO Pro Today!', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=v4-lite&utm_medium=Plugin%20Notification&utm_content=memorial-day-sale-2023-get-aioseo-pro-today', NULL, NULL, 0, 1, '2023-05-30 05:55:14', '2023-06-01 07:59:19'),
(38, '64798bb111d25', NULL, '[NEW] Set a Primary Category to Customize Breadcrumbs (+ WPCode Integration) 🚀', '<strong>The wait is FINALLY over!</strong> One of our most requested feature is live in AIOSEO 4.3.8! 🎉 🎉\r\n<br><br>\r\nWith the brand-new <strong>Primary Category</strong> feature, you now have <strong>full control over which category displays in your breadcrumb trail</strong>.\r\n<br><br>\r\nPlus: customize your AIOSEO experience with <strong>clickable code snippets</strong> courtesy of WPCode!\r\n<br><br>\r\nUpgrade to <strong>AIOSEO 4.3.8 Pro TODAY</strong> to ignite your SEO and outrank competitors!', 'success', '[\"4-x\",\"lite\"]', 751, NULL, '2023-07-25 13:50:35', NULL, 'Learn More', 'https://aioseo.com/announcing-primary-category-and-wpcode-integration/?utm_source=WordPress&utm_campaign=primary-category-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=primary-category-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 1, '2023-06-02 06:26:57', '2023-07-28 13:27:34');
