(39, '649b505dc197f', NULL, 'It\'s a Sweet Sixteen Kinda Day! 🥳 🥳', '<img src=\"data:image/png;base64,\" />\r\n\r\nWe just had our 16th birthday, and to celebrate, we’re offering you massive discounts on all paid plans. Save <strong>up to 70%</strong> when you purchase a new plan or upgrade TODAY!\r\n<br><br>\r\nPlus, we have a <strong>sweet giveaway</strong> with 3 prizes including a <strong>Pixel 7 Pro, Pixel Tablet and Pixel Buds Pro</strong>!\r\n<br><br>\r\nHurry, this deal won\'t last long, check it out TODAY!', 'success', '[\"4-x\",\"lite\"]', 766, NULL, '2023-06-27 12:55:16', '2023-06-30 00:00:00', 'Get AIOSEO Pro NOW! (70% OFF)', 'https://aioseo.com/happy-birthday-aioseo/?utm_source=WordPress&utm_campaign=16th-birthday-sale-v4-lite&utm_medium=plugin-notification&utm_content=Get AIOSEO Pro NOW! (70% OFF)', 'Enter Pixel Giveaway!', 'https://aioseo.com/happy-birthday-aioseo/?utm_source=WordPress&utm_campaign=16th-birthday-sale-v4-lite&utm_medium=plugin-notification&utm_content=Enter Pixel Giveaway!', 0, 1, '2023-06-27 21:10:53', '2023-06-28 22:30:28'),
(40, '64a514539df9e', NULL, '🔥 [New] Advanced SEO Tracking with SEO Revisions & Google Updates Integration', 'Track the changes you make to your content and see how it <strong>connects to changes in your search rankings</strong>.\r\n<br><br>\r\nPlus, see <strong>Google Updates on a timeline in Search Statistics</strong>, so you know how they impact your SEO.\r\n<br><br>\r\nWe’ve also added many more new features to version 4.4.0 of AIOSEO. <strong>Upgrade today!</strong>', 'success', '[\"4-x\",\"lite\"]', 801, NULL, '2023-07-28 18:10:46', NULL, 'Learn More', 'https://aioseo.com/announcing-seo-revisions-and-google-updates-integration/?utm_source=WordPress&utm_campaign=seo-revisions-v4-lite&utm_medium=plugin-notification&utm_content=Learn%20More', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=seo-revisions-v4-lite&utm_medium=plugin-notification&utm_content=Get%20AIOSEO%20Pro', 0, 1, '2023-07-05 06:57:23', '2023-08-02 07:51:15'),
(41, '64c0b8bd8c288', NULL, 'NEW: Announcing the AIOSEO Analyzer Chrome extension!  🚀', 'Speed up content reviews and technical SEO checks. This new free tool is designed for you!\r\n<br><br>\r\nAIOSEO Analyzer gives you a big-picture view of your SEO, bringing problem areas into sharp focus. It works on both unpublished <em>and</em> published pages.\r\n<br><br>\r\nAnd it’s <strong>100% free!</strong> Download it today from the Chrome Web Store. And take it for a test drive!', 'success', '[\"4-x\"]', 809, NULL, '2023-07-28 18:10:46', NULL, 'Learn More', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Learn%20More', 'Download', 'https://aioseo.com/announcing-all-in-one-analyzer-by-aioseo/?utm_source=WordPress&utm_campaign=chrome-extension-v4&utm_medium=plugin-notification&utm_content=Download', 0, 1, '2023-07-26 06:10:05', '2023-08-02 07:51:15'),
(42, '64c5e48bcd6aa', NULL, '🌴🌞 Embrace the summer vibes with our scorching HOT Summer Sale! 🌞🌴', '<img src=\"data:image/png;base64,\" />\r\n\r\nIt\'s time to turn up the heat and celebrate the season in style. Whether you\'re a long-time user or a brand-new one, we\'ve got something special for you!\r\n<br><br>\r\nIn honor of summer, we\'re offering you sensational discounts on all paid plans. Save up to a refreshing 70% when you snag a new plan or upgrade TODAY!\r\n<br><br>\r\nBut don\'t lounge around too long under the sun – this irresistible offer won\'t last forever! So, hurry and dive into our Summer Sale before it\'s gone. Your special deal awaits!\r\n', 'success', '[\"4-x\",\"lite\"]', 827, NULL, '2023-07-28 18:10:46', '2023-08-04 00:00:00', 'Get AIOSEO Pro NOW! (70% OFF)', 'https://aioseo.com/pricing-lite/?utm_source=WordPress&utm_campaign=summer-sale-v4-lite&utm_medium=plugin-notification&utm_content=Upgrade Your AIOSEO Plan NOW! (70% OFF)', NULL, NULL, 0, 1, '2023-07-30 04:18:19', '2023-08-02 07:51:15');
