(48419, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:49:\"How Web Creators Can Start Live Streaming in 2022\";s:7:\"excerpt\";s:281:\"Web creators can gain great benefits from live streaming — displaying their work, generating engagement, and networking with other creators. Discover how to start live streaming on the web, from collecting the basic streaming gear to choosing the best platform for your audience.\";s:7:\"created\";i:1648003040;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:149:\"https://elementor.com/blog/how-web-creators-can-start-live-streaming-in-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:35:\"Elementor Websites of February 2022\";s:7:\"excerpt\";s:263:\"February’s showcase adds some much-needed color and excitement to the long wintery season. From high-end business technology and creative NFTs to underground urban paintings and community arts and so much in between, these websites offer something for everyone.\";s:7:\"created\";i:1647516309;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/showcase-february-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:54:\"6 Top Ecommerce Security Threats and Solutions of 2022\";s:7:\"excerpt\";s:267:\"According to recent studies, 32% of direct and organic traffic to ecommerce sites comes from Invalid Traffic — bots, malicious users, or suspicious users. In this article, we will dive deeper into some of these threats and offer the best solutions to address them.\";s:7:\"created\";i:1647217020;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:144:\"https://elementor.com/blog/top-ecommerce-security-threats-and-solutions/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:36:\"4 Women Making Moves in Web Creation\";s:7:\"excerpt\";s:173:\"Today is International Women’s Day, and what better way to celebrate girl power than with some inspiring stories from women web creators in our community across the globe.\";s:7:\"created\";i:1646738701;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:134:\"https://elementor.com/blog/women-making-moves-in-web-creation/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:75:\"The Opportunities and Challenges of Being a Female Web Entrepreneur in 2022\";s:7:\"excerpt\";s:305:\"While the web creates more equal opportunities, female founders secured only 2% of venture capital in the U.S. in 2021. Miriam Schwab, Co-founder and CEO of Strattic, shares her personal story and challenges as a female tech entrepreneur and why she firmly believes the future is bright for women in tech.\";s:7:\"created\";i:1646732431;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:149:\"https://elementor.com/blog/challenges-opportunities-for-female-entrepreneurs/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
