				\n				\n				\n				\n				\n				<div class=\"et_pb_row et_pb_row_13\">\n				<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_80  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_20  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">About Me.</div>\n			</div><div class=\"et_pb_module et_pb_image et_pb_image_9\">\n				\n				\n				\n				\n				<span class=\"et_pb_image_wrap \"><img width=\"700\" height=\"700\" src=\"https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=700%2C700&#038;ssl=1\" alt=\"\" title=\"Marco\" srcset=\"https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?w=700&ssl=1 700w, https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=300%2C300&ssl=1 300w, https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=150%2C150&ssl=1 150w, https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=480%2C480&ssl=1 480w, https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=600%2C600&ssl=1 600w, https://i0.wp.com/colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg?resize=100%2C100&ssl=1 100w\" sizes=\"(max-width: 700px) 100vw, 700px\" class=\"wp-image-151\" data-recalc-dims=\"1\" /></span>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_2 et_pb_column_81  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_21  et_pb_text_align_justified et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">While serving 4 years in the US Navy, I was a part of several operations from Air, Land or Sea while on the USS Cleveland LPD 7, Gator Navy. A “Jack of All Trades, Master of All” was the Boatswain mates’ (BM) motto, my original “job” in the military; my second was Intelligent Specialist (IS). I took this Centuries old motto to my civilian life. <br />\nMy Information Technology career started immediately after my military service ended in 1997. After finishing college, I was awarded a position as a Help Desk Analytics with the Sutherland Group after completing at the top of my internship group. The fundamental Cisco knowledge I obtain as a Network technician working for Cbeyond – a Birch Company was only the start. Peregrine semiconductor, now Murata gave me my first opportunity as a leader, Asset Manager and allow me to sharpen my skills Windows Server administration. In 2016 served as a Linux administrator supporting a team of scientist on the west and east coast for Janssen Pharmaceuticals. Beginning in 2018, I decided to use my passion to start my own IT contracting business.  <br />\n Through constant continuing education, training and 20 years of IT experience, we at Coleman Technical Support Services (CTSS) hope to meet or exceed your IT needs. </div>\n			</div><div class=\"et_pb_module et_pb_text et_pb_text_22  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Marcus Coleman</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row et_pb_row_14\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_82  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_23  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">We also offer blocks of it services<br />\nProvide how every many blocks of IT service to use within a year!</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div>\n				\n				\n			</div><div class=\"et_pb_section et_pb_section_48 et_section_regular\" >\n				\n				\n				\n				\n				\n				\n				<div class=\"et_pb_with_border et_pb_row et_pb_row_15 et_animated\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_83  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_button_module_wrapper et_pb_button_1_wrapper  et_pb_module \">\n				<a class=\"et_pb_button et_pb_button_1 et_pb_bg_layout_light\" href=\"http://colemanindustriesllc.net/CILLC/\" target=\"_blank\">CILLC - GUN SHOP</a>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div>\n				\n				\n			</div><div class=\"et_pb_section et_pb_section_49 et_clickable et_pb_with_background et_section_specialty\" >\n				\n				\n				\n				\n				\n				<div class=\"et_pb_row\">\n				<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_84    et_pb_css_mix_blend_mode_passthrough et_pb_column_empty\">\n				\n				\n				\n				\n				\n			</div><div class=\"et_pb_column et_pb_column_1_2 et_pb_column_85   et_pb_specialty_column  et_pb_css_mix_blend_mode_passthrough et-last-child et_pb_column_empty\">\n				\n				\n				\n				\n				\n			</div>\n				</div>\n				\n			</div><div id=\"contact\" class=\"et_pb_with_border et_pb_section et_pb_section_50 et_pb_with_background et_section_regular\" >\n				\n				\n				\n				\n				\n				\n				<div class=\"et_pb_row et_pb_row_16\">\n				<div class=\"et_pb_column et_pb_column_1_4 et_pb_column_86  et_pb_css_mix_blend_mode_passthrough et_pb_column_empty\">\n				\n				\n				\n				\n				\n			</div><div class=\"et_pb_column et_pb_column_3_4 et_pb_column_87  et_pb_css_mix_blend_mode_passthrough et-last-child et_pb_column_empty\">\n				\n				\n				\n				\n				\n			</div>\n				\n				\n				\n				\n			</div>\n				\n				\n			</div><div class=\"et_pb_section et_pb_section_51 et_pb_with_background et_section_regular\" >\n				\n				\n				\n				\n				\n				\n				<div class=\"et_pb_row et_pb_row_17\">\n				<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_88  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_24  et_pb_text_align