and other non-savvy computer users who just want the device to work. She doesn\'t want to know how, just make it work. I enjoy helping all type of users but these the one\'s who \"hate computers\" have a special place in my heart!</p>\n<p>I want to change this entire relationship Computer Users commonly have with IT support. In my experience some IT techs come off as harsh, cocky, rude, sometimes lacking knowledge OR to must knowledge when dealing with most users. We strive to speak in NON-IT language (unless you speak it) to make it easy to understand the why, what and how.</p>\n<p>We here at CILLC have received the IT training so you can leave the IT \"stuff\" to us. This leaves you, our Customer with time to work on your business and your life! We love this IT stuff!</p>\n<p>Our main and only objective is to give YOU the customer a great IT experience you will not soon forget!</p>[/et_pb_text][et_pb_text _builder_version=\"4.10.4\" text_font=\"Sacramento||||||||\" text_text_color=\"#000000\" text_font_size=\"72px\" text_line_height=\"1.2em\" text_font_size_tablet=\"\" text_font_size_phone=\"40px\" text_font_size_last_edited=\"on|tablet\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]Marcus Coleman[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.10.4\" _module_preset=\"default\" custom_padding=\"50px||50px|||\" global_colors_info=\"{}\"][et_pb_column type=\"4_4\" _builder_version=\"4.10.4\" _module_preset=\"default\" global_colors_info=\"{}\"][et_pb_text _builder_version=\"4.10.4\" header_font=\"||||||||\" header_2_font=\"Montserrat|800||on|||||\" header_2_text_align=\"center\" header_2_text_color=\"#000000\" header_2_font_size=\"40px\" header_2_line_height=\"1.2em\" header_4_font=\"Montserrat|600|||||||\" header_4_text_align=\"center\" header_4_font_size=\"24px\" module_alignment=\"right\" header_2_font_size_tablet=\"40px\" header_2_font