m\" always_center_on_mobile=\"off\" global_colors_info=\"{}\"][/et_pb_image][et_pb_slider _builder_version=\"4.10.4\" header_level=\"h4\" header_font=\"Montserrat|700|||||||\" header_font_size=\"26px\" header_line_height=\"1.6em\" body_font=\"|700|||||||\" body_text_color=\"#31d190\" background_color=\"rgba(255,255,255,0)\" custom_padding=\"0px||\" header_font_size_tablet=\"20px\" header_font_size_phone=\"18px\" header_font_size_last_edited=\"on|phone\" global_colors_info=\"{}\"][et_pb_slide heading=\"Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi\" _builder_version=\"4.10.4\" body_text_color=\"#f3713b\" global_colors_info=\"{}\" sticky_transition=\"on\"]<p>John Doe on Code of art.</p>[/et_pb_slide][/et_pb_slider][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"3.22.7\" locked=\"off\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"3.25\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"3.25\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text _builder_version=\"4.10.4\" header_font=\"||||||||\" header_2_font=\"Montserrat|800||on|||||\" header_2_text_color=\"#000000\" header_2_font_size=\"60px\" header_2_line_height=\"1.2em\" module_alignment=\"right\" header_2_font_size_tablet=\"40px\" header_2_font_size_phone=\"25px\" header_2_font_size_last_edited=\"on|desktop\" locked=\"off\" global_colors_info=\"{}\"]<h2>About Me.</h2>[/et_pb_text][et_pb_image src=\"https://colemanindustriesllc.net/wp-content/uploads/2021/10/Marco.jpg\" title_text=\"Marco\" _builder_version=\"4.10.4\" max_width_tablet=\"200px\" max_width_phone=\"\" max_width_last_edited=\"on|desktop\" animation_direction=\"bottom\" border_radii=\"on|300px|300px|300px|300px\" always_center_on_mobile=\"off\" global_colors_info=\"{}\"][/et_pb_image][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.25\" custom_padding=\"84px|||\" custom_padding_tablet=\"0px|||\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|tablet\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text _builder_version=\"4.10.4\" text_font=\"||||||||\" text_font_size=\"18px\" text_line_height=\"1.8em\" text_orientation=\"justified\" text_font_size_tablet=\"16px\" text_font_size_phone=\"14px\" text_font_size_last_edited=\"on|phone\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]<p>While serving 4 years in the US Navy, I was a part of several operations from flight to deck while on the USS Cleveland LPD 7, Gator Navy. A “Jack of All Trades, Master of All” was the Boatswain mates’ (BM) motto, my original “job” in the military; my second was Intelligent Specialist (IS). I took this Centuries old motto to my civilian life.</p>\n<p>My Information Technology career started immediately after my military service ended in 1997. I was awarded a position as a Help Desk Analytics with the Sutherland Group after completing at the top of my internship group. Cisco Networking was a skill I acquired that lead to being hire as Network technician for Cbeyond – a Birch Company. I served as a Linux administrator supporting a team of scientist for Janssen Pharmaceuticals. The extensive Windows server administration talents I have gained throughout my 20-year career in Information technology have allowed me to resolve windows issues quickly.</p>\n<p>Through constant continuing education and training, I am very experienced in Information Technology. We at Coleman Technical Support Services (CTSS) hope to meet or exceed your IT needs.</p>[/et_pb_text][et_pb_text _builder_version=\"4.10.4\" text_font=\"Sacramento||||||||\" text_text_color=\"#000000\" text_font_size=\"72px\" text_line_height=\"1.2em\" text_font_size_tablet=\"\" text_font_size_phone=\"40px\" text_font_size_