ion Technology career started immediately after my military service ended in 1997. I was awarded a position as a Help Desk Analytics with the Sutherland Group after completing at the top of my internship group. Cisco Networking was a skill I acquired that lead to being hire as Network technician for Cbeyond – a Birch Company. I served as a Linux administrator supporting a team of scientist for Janssen Pharmaceuticals. The extensive Windows server administration talents I have gained throughout my 20-year career in Information technology have allowed me to resolve windows issues quickly.</p>\n<p>Through constant continuing education and training, I am very experienced in Information Technology. We at Coleman Technical Support Services (CTSS) hope to meet or exceed your IT needs.</p>[/et_pb_text][et_pb_text _builder_version=\"4.10.4\" text_font=\"Sacramento||||||||\" text_text_color=\"#000000\" text_font_size=\"72px\" text_line_height=\"1.2em\" text_font_size_tablet=\"\" text_font_size_phone=\"40px\" text_font_size_last_edited=\"on|tablet\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]Marcus Coleman[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.10.4\" _module_preset=\"default\" custom_padding=\"50px||50px|||\" global_colors_info=\"{}\"][et_pb_column type=\"4_4\" _builder_version=\"4.10.4\" _module_preset=\"default\" global_colors_info=\"{}\"][et_pb_text _builder_version=\"4.10.4\" header_font=\"||||||||\" header_2_font=\"Montserrat|800||on|||||\" header_2_text_align=\"center\" header_2_text_color=\"#000000\" header_2_font_size=\"40px\" header_2_line_height=\"1.2em\" header_4_font=\"Montserrat|600|||||||\" header_4_text_align=\"center\" header_4_font_size=\"24px\" module_alignment=\"right\" header_2_font_size_tablet=\"40px\" header_2_font_size_phone=\"25px\" header_2_font_size_last_edited=\"on|desktop\" locked=\"off\" global_colors_info=\"{