Navy. A “Jack of All Trades, Master of All” was the Boatswain mates’ (BM) motto, my original “job” in the military; my second was Intelligent Specialist (IS). I took this Centuries old motto to my civilian life.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>\n<p><span data-contrast=\"auto\">My Information Technology career started immediately after my military service ended in 1997. After finishing college, I was awarded a position as a Help Desk Analytics with the Sutherland Group after completing at the top of my internship group. The fundamental Cisco knowledge I obtain as a Network technician working for Cbeyond – a Birch Company was only the start. Peregrine semiconductor, now Murata gave me my first opportunity as a leader, Asset Manager and allow me to sharpen my skills Windows Server administration. In 2016 served as a Linux administrator supporting a team of scientist on the west and east coast for Janssen Pharmaceuticals. Beginning in 2018, I decided to use my passion to start my own IT contracting business. </span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>\n<p><span data-contrast=\"auto\"> Through constant continuing education, training and 20 years of IT experience, we at Coleman Technical Support Services (CTSS) hope to meet or exceed your IT needs.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>[/et_pb_text][et_pb_text _builder_version=\"4.10.4\" text_font=\"Sacramento||||||||\" text_text_color=\"#000000\" text_font_size=\"72px\" text_line_height=\"1.2em\" text_font_size_tablet=\"\" text_font_size_phone=\"40px\" text_font_size_last_edited=\"on|tablet\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]Marcus Coleman[/et_pb_text][/et_pb