eader_font_size_last_edited=\"on|phone\" global_colors_info=\"{}\"][et_pb_slide heading=\"Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi\" _builder_version=\"4.16\" body_text_color=\"#f3713b\" global_colors_info=\"{}\" sticky_transition=\"on\"]<p>John Doe on Code of art.</p>[/et_pb_slide][/et_pb_slider][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"4.16\" locked=\"off\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.16\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text _builder_version=\"4.16\" header_font=\"||||||||\" header_2_font=\"Montserrat|800||on|||||\" header_2_text_color=\"#000000\" header_2_font_size=\"60px\" header_2_line_height=\"1.2em\" module_alignment=\"right\" header_2_font_size_tablet=\"40px\" header_2_font_size_phone=\"25px\" header_2_font_size_last_edited=\"on|desktop\" locked=\"off\" global_colors_info=\"{}\"]<h2>About Me.</h2>[/et_pb_text][et_pb_image src=\"https://colemanindustriesllc.net/wp-content/uploads/2021/12/Marco.jpg\" title_text=\"Marco\" _builder_version=\"4.16\" max_width_tablet=\"200px\" max_width_phone=\"\" max_width_last_edited=\"on|desktop\" animation_direction=\"bottom\" border_radii=\"on|300px|300px|300px|300px\" always_center_on_mobile=\"off\" global_colors_info=\"{}\"][/et_pb_image][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"84px|||\" custom_padding_tablet=\"0px|||\" custom_padding_phone=\"\" custom_padding_last_edited=\"on|tablet\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text _builder_version=\"4.16\" text_font=\"||||||||\" text_font_size=\"18px\" text_line_height=\"1.8em\" text_orientation=\"justified\" text_font_size_tablet=\"16px\" text_font_size_phone=\"14px\" text_font_size_last_edited=\"on|phone\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]<p><span data-contrast=\"auto\">While serving 4 years in the US Navy, I was a part of several operations from Air, Land or Sea while on the USS Cleveland LPD 7, Gator Navy. A “Jack of All Trades, Master of All” was the Boatswain mates’ (BM) motto, my original “job” in the military; my second was Intelligent Specialist (IS). I took this Centuries old motto to my civilian life.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>\n<p><span data-contrast=\"auto\">My Information Technology career started immediately after my military service ended in 1997. After finishing college, I was awarded a position as a Help Desk Analytics with the Sutherland Group after completing at the top of my internship group. The fundamental Cisco knowledge I obtain as a Network technician working for Cbeyond – a Birch Company was only the start. Peregrine semiconductor, now Murata gave me my first opportunity as a leader, Asset Manager and allow me to sharpen my skills Windows Server administration. In 2016 served as a Linux administrator supporting a team of scientist on the west and east coast for Janssen Pharmaceuticals. Beginning in 2018, I decided to use my passion to start my own IT contracting business. </span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>\n<p><span data-contrast=\"auto\"> Through constant continuing education, training and 20 years of IT experience, we at Coleman Technical Support Services (CTSS) hope to meet or exceed your IT needs.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\"> </span></p>[/et_pb_text][et_pb_text _builder_version=\"4.16\" text_font=\"Sacramento||||||||\" text_text_color=\"#000000\" text_font_size=\"72px\" text_line_height=\"1.2em\" text_font_size_tablet=\"\" text_font_size_phone=\"40px\" text_font_size_last_edited=\"on|tablet\" text_line_height_tablet=\"1.8em\" text_line_height_phone=\"1.7em\" text_line_height_last_edited=\"off|phone\" locked=\"off\" global_colors_info=\"{}\"]Marcus Coleman[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"4.16\" _module_preset=\"default\" custom_padding=\"50px||50px|||\" global_colors_info=\"{}\"][et_pb_column type=\"4_4\" _builder_version=\"4.16\" _module_preset=\"default\" global_colors_info=\"{}\"][et_pb_text _builder_version=\"4.16\" header_font=\"||||||||\" header_2_font=\"Montserrat|800||on|||||\" header_2_text_align=\"center\" header_2_text_color=\"#000000\" header_2_font_size=\"40px\" header_2_line_height=\"1.2em\" header_4_font=\"Montserrat|600|||||||\" header_4_text_align=\"center\" header_4_font_size=\"24px\" module_alignment=\"right\" header_2_font_size_tablet=\"40px\" header_2_font_size_phone=\"25px\" header_2_font_size_last_edited=\"on|desktop\" locked=\"off\" global_colors_info=\"{}\"]<h2>We also offer blocks of it services</h2>\n<h4>Provide how every many blocks of IT service to use within a year!</h4>[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" specialty=\"on\" _builder_version=\"4.17.0\" _module_preset=\"default\" hover_enabled=\"0\" global_colors_info=\"{}\" link_option_url=\"colemanindustriesllc.net/CILLC/\" link_option_url_new_window=\"on\" title_text=\"CILLC LOGO\" background_image=\"https://colemanindustriesllc.net/wp-content/uploads/2022/04/CILLC-LOGO.png\" background_size=\"stretch\" sticky_enabled=\"0\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][/et_pb_column][et_pb_column type=\"1_2\" specialty_columns=\"2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][/et_pb_column][