(66, 'wc_simple_payments_m2_reader_launch_q1_2022', 'marketing', 'en_US', 'Take quick and easy in-person payments', 'WooCommerce is continuing to power up your business with our new Simple Payments feature, built exclusively for WooCommerce In-Person Payments. Capture quick and simple payments anywhere else your customers are – or offer a local pickup option with payment taken in-person for orders placed online.', '{}', 'unactioned', 'woocommerce.com', '2022-02-04 06:38:32', NULL, 0, 'plain', '', 0, 'info', 0),
(67, 'wcpay_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with Apple Pay – just like Diane does', 'See how Diane from <a href=\"https://woocommerce.com/posts/lady-dye-yarns-from-crafts-to-activism-with-woocommerce/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Lady Dye Yarns</a> uses Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – Apple Pay is included in WooCommerce Payments. Here\'s how you can increase conversions by encouraging shoppers to pay with a single tap.', '{}', 'pending', 'woocommerce.com', '2022-02-07 06:46:41', NULL, 0, 'plain', '', 0, 'info', 0),
(68, 'stripe_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with Apple Pay – just like Thomas does', 'Read the inspirational story of <a href=\"https://woocommerce.com/posts/incredible-story-of-thomas-trendy-socks-down-syndrome-entrepreneur/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Thomas\'s Trendy Socks</a> and see how he’s using Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – ready to turn more visitors into buyers? Accept Apple Pay by selecting Enable express checkouts in Settings &gt; Payments &gt; Stripe.', '{}', 'pending', 'woocommerce.com', '2022-02-07 06:46:41', NULL, 0, 'plain', '', 0, 'info', 0),
(69, 'square_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with a faster checkout experience', 'By enabling Apple Pay in Square, your customers can complete purchases quickly and securely with a single touch or a glance – no lengthy checkout forms necessary. Accept Apple Pay by enabling Digital Wallets within Settings &gt; Payments &gt; Square.', '{}', 'pending', 'woocommerce.com', '2022-02-07 06:46:41', NULL, 0, 'plain', '', 0, 'info', 0),
(70, 'lead_gen_existing_customers_1', 'marketing', 'en_US', 'Talk to a consultant', 'As your business grows, you want to optimize costs, streamline operations, and sell more. We can help. Talk to us about how you can get the most out of WooCommerce.', '{}', 'unactioned', 'woocommerce.com', '2022-02-12 06:49:03', NULL, 0, 'plain', '', 0, 'info', 0),
(71, 'woocommerce-core-paypal-march-2022-updated', 'update', 'en_US', 'Security auto-update of WooCommerce', '<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). It’s recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.', '{}', 'pending', 'woocommerce.com', '2022-03-11 06:16:07', NULL, 0, 'plain', '', 0, 'info', 0),
(72, 'woocommerce-core-paypal-march-2022-updated-nopp', 'update', 'en_US', 'Security auto-update of WooCommerce', '<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).', '{}', 'actioned', 'woocommerce.com', '2022-03-11 06:16:07', NULL, 0, 'plain', '', 0, 'info', 1),
(73, 'pinterest_03_2022_update', 'marketing', 'en_US', 'Your Pinterest for WooCommerce plugin is out of date!', 'Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on “update now” under Pinterest for WooCommerce.', '{}', 'pending', 'woocommerce.com', '2022-03-24 05:47:02', NULL, 0, 'plain', '', 0, 'info', 0),
(74, 'wc-admin-navigation-nudge', 'info', 'en_US', 'You now have access to the WooCommerce navigation', 'We’re introducing a new navigation for a more intuitive and improved user experience. You can enable the beta version of the new experience in the Advanced Settings. Enable it now for your store.', '{}', 'unactioned', 'woocommerce-admin', '2022-04-14 05:48:25', NULL, 0, 'plain', '', 0, 'info', 0),
(75, 'wc-admin-performance-on-mobile', 'info', 'en_US', 'Track your store performance on mobile', 'Monitor your sales and high performing products with the Woo app.', '{}', 'unactioned', 'woocommerce-admin', '2022-04-16 05:46:19', NULL, 0, 'plain', '', 0, 'info', 0),
(76, 'pinterest_gtm_q2_2021', 'marketing', 'en_US', 'Get your products in front of a large, engaged audience', 'Did you know that shoppers on Pinterest spend twice as much as people on other social platforms? With the new, official Pinterest for WooCommerce, you can turn your product catalog into shoppable Pins and showcase them to 400+ million monthly users looking to buy.', '{}', 'unactioned', 'woocommerce.com', '2022-04-24 05:48:41', NULL, 0, 'plain', '', 0, 'info', 0),
(77, 'setup_task_initiative_survey_q2_2022', 'survey', 'en_US', 'We want to know what matters most to you', 'Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.', '{}', 'pending', 'woocommerce.com', '2022-04-27 05:47:37', NULL, 0, 'plain', '', 0, 'info', 0),
(78, 'woocommerce_payments_subscriptions_nopayments_q2_2022', 'marketing', 'en_US', 'Sell subscriptions online – without a paid extension', 'Say hello to WooCommerce Payments – now with built-in subscriptions functionality. Get free access to the features you need to start earning recurring revenue online. Pay as you go, with no setup costs or monthly fees.', '{}', 'unactioned', 'woocommerce.com', '2022-04-27 05:47:38', NULL, 0, 'plain', '', 0, 'info', 0),
(79, 'woocommerce_payments_subscriptions_yespayments_q2_2022', 'marketing', 'en_US', 'Sell subscriptions online – no extra extension required', 'It\'s here! WooCommerce Payments now features built-in subscriptions functionality. No need to install an extra, paid extension – we\'ve made it simpler than ever to start earning recurring revenue. Ready to grow your business?', '{}', 'pending', 'woocommerce.com', '2022-04-27 05:47:38', NULL, 0, 'plain', '', 0, 'info', 0),
(80, 'setup_task_second_survey_q2_2022', 'survey', 'en_US', 'We want to know what matters most to you', 'Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.', '{}', 'unactioned', 'woocommerce.com', '2022-05-10 05:48:20', NULL, 0, 'plain', '', 0, 'info', 0),
(81, 'store_setup_survey_survey_q2_2022', 'survey', 'en_US', 'How is your store setup going?', 'Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWe’d love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.', '{}', 'pending', 'woocommerce.com', '2022-05-10 05:48:20', NULL, 0, 'plain', '', 0, 'info', 0),
(82, 'affirm_q2_2022', 'marketing', 'en_US', 'Boost your business with flexible payments', 'Expand your customer base with smarter payment options for more shoppers. With Affirm,  you can offer the most relevant payment options at every price point – from four interest-free payments every two weeks to longer installments up to 36 months. Fast-track your revenue goals today!', '{}', 'unactioned', 'woocommerce.com', '2022-05-15 05:48:45', NULL, 0, 'plain', '', 0, 'info', 0),
(83, 'wc-admin-EU-consumer-protection', 'marketing', 'en_US', 'Important changes to EU consumer protection laws', 'New regulations to help modernize and strengthen consumer protection laws in the European Union (EU) take effect on May 28, 2022. These rules impact all merchants selling to the EU, regardless of where their business is located. Further detailed information is available on the European Commission\'s official website.', '{}', 'unactioned', 'woocommerce.com', '2022-05-15 05:48:45', NULL, 0, 'plain', '', 0, 'info', 0),
(84, 'googlelistings_multicountrygtm_q22022', 'marketing', 'en_US', 'Expand your audience with Multi-Country Advertising', 'It\'s time to expand your audience with Multi-Country Advertising, an exciting new feature in Google Listings &amp; Ads. Reach more potential customers in as many regions as you like within a single campaign, all from the convenience of your WooCommerce dashboard.', '{}', 'unactioned', 'woocommerce.com', '2022-05-16 05:47:29', NULL, 0, 'plain', '', 0, 'info', 0),
(85, 'wc-refund-returns-page', 'info', 'en_US', 'Setup a Refund and Returns Policy page to boost your store\'s credibility.', 'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.', '{}', 'unactioned', 'woocommerce-core', '2022-05-21 20:27:40', NULL, 0, 'plain', '', 0, 'info', 0),
(86, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2022-05-22 05:54:39', NULL, 0, 'plain', '', 0, 'info', 0),
(87, 'wc_ipp_order_creation_GTM_launch_q2_2022', 'marketing', 'en_US', 'Grow your business on the go with WooCommerce In-Person Payments', 'Quickly create new orders, manage transactions, and take secure payments no matter where your business takes you. With automatic inventory sync, WooCommerce In-Person Payments is the only fully integrated solution for taking your WooCommerce store offline.', '{}', 'unactioned', 'woocommerce.com', '2022-05-26 05:49:28', NULL, 0, 'plain', '', 0, 'info', 0),
(88, 'wc-admin-wisepad3', 'marketing', 'en_US', 'Take your business on the go in Canada with WooCommerce In-Person Payments', 'Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory – no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.', '{}', 'pending', 'woocommerce.com', '2022-06-16 05:47:01', NULL, 0, 'plain', '', 0, 'info', 0),
(89, 'TikTok q2_2022', 'marketing', 'en_US', 'Give your store a stage on the world’s fastest-growing advertising channel', 'With TikTok for WooCommerce, you can sync your catalog, create videos, and track performance in front of TikTok’s one billion global users. Try the Smart Video Generator to make ads using your existing product images – no camera needed. Get $200 in ad credit from TikTok after a $20 spend (terms &amp; conditions apply).', '{}', 'unactioned', 'woocommerce.com', '2022-06-22 05:39:59', NULL, 0, 'plain', '', 0, 'info', 0),
(90, 'tiktok-webinar-promo-july2022', 'marketing', 'en_US', 'Free webinar: TikTok for WooCommerce', 'Join WooCommerce and TikTok live on July 14 to learn about ad types, trends, and the best ways to connect with an audience of one billion active users on the world’s fastest-growing social platform. Participants have a chance to score a free month of Vimeo Pro, and two winners will get a $5,000 ad credit and more.', '{}', 'pending', 'woocommerce.com', '2022-07-09 05:46:32', NULL, 0, 'plain', '', 0, 'info', 0),
(91, 'wc-admin-edit-products-on-the-move', 'info', 'en_US', 'Edit products on the move', 'Edit and create new products from your mobile devices with the Woo app', '{}', 'unactioned', 'woocommerce-admin', '2022-07-20 05:48:26', NULL, 0, 'plain', '', 0, 'info', 0),
(92, 'klarna_q3_2022', 'marketing', 'en_US', 'Meet Klarna – your ultimate growth partner', 'Increase conversions by offering secure, flexible payment solutions – including buy now, pay later – all through a one-click checkout experience. Plus, you’ll tap into a whole new market of the world’s most engaged shoppers.', '{}', 'unactioned', 'woocommerce.com', '2022-08-08 05:51:52', NULL, 0, 'plain', '', 0, 'info', 0),
(93, 'mercado_pago_q3_2022', 'marketing', 'en_US', 'Get paid with Mercado Pago Checkout', 'Give your customers a checkout they can trust with Latin America\'s leading payment processor. Securely accept debit and credit cards, cash, bank transfers, and installment payments – backed by exclusive fraud prevention tools.', '{}', 'pending', 'woocommerce.com', '2022-08-09 05:47:20', NULL, 0, 'plain', '', 0, 'info', 0),
(94, 'woocommerce-payments-august-2022-need-to-update', 'update', 'en_US', 'Action required: Please update WooCommerce Payments', 'An updated secure version of WooCommerce Payments is available – please ensure that you’re using the latest patch version. For more information on what action you need to take, please review the article below.', '{}', 'pending', 'woocommerce.com', '2022-08-10 05:46:40', NULL, 0, 'plain', '', 0, 'info', 0),
(95, 'woocommerce-payments-august-2022-store-patched', 'update', 'en_US', 'WooCommerce Payments has been automatically updated', 'You’re now running the latest secure version of WooCommerce Payments. We’ve worked with the WordPress Plugins team to deploy a security update to stores running WooCommerce Payments (version 3.9 to 4.5). For further information, please review the article below.', '{}', 'pending', 'woocommerce.com', '2022-08-10 05:46:40', NULL, 0, 'plain', '', 0, 'info', 0),
(96, 'mobile_app_order_management_q3_2022', 'marketing', 'en_US', 'Take order management on the go', 'The WooCommerce Mobile App continues to get better with added order management functionality! Add or remove products, edit fees, or change the shipping options in any existing order – all from within the app.', '{}', 'unactioned', 'woocommerce.com', '2022-08-17 05:47:46', NULL, 0, 'plain', '', 0, 'info', 0),
(97, 'product_creation_usability_test_3_months', 'survey', 'en_US', 'Have a say in the future of WooCommerce', 'Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.', '{}', 'pending', 'woocommerce.com', '2022-08-26 05:47:40', NULL, 0, 'plain', '', 0, 'info', 0),
(98, 'product_creation_usability_test_6_months', 'survey', 'en_US', 'Try the new product edit form prototype', 'Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.', '{}', 'pending', 'woocommerce.com', '2022-08-30 05:47:04', NULL, 0, 'plain', '', 0, 'info', 0),
(99, 'product_creation_usability_test_12_months', 'survey', 'en_US', 'Try the new product edit form prototype', 'Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.', '{}', 'pending', 'woocommerce.com', '2022-09-07 05:53:03', NULL, 0, 'plain', '', 0, 'info', 0),
(100, 'custom_deposit_schedules_inbox', 'marketing', 'en_US', 'Customize your deposit schedule', 'Receive your funds according to your own business needs with custom deposit schedules from WooCommerce Payments. You’ll have the flexibility to deposit funds into your bank account daily, weekly, monthly, or even on-demand – you’ve done the work, now get paid on your terms.', '{}', 'unactioned', 'woocommerce.com', '2022-09-15 05:53:49', NULL, 0, 'plain', '', 0, 'info', 0),
(101, 'googlelistings_signals2022_hasGLA', 'marketing', 'en_US', 'Show off your products with Ads on Google', 'You’re ready to grow with ads. Google optimizes for performance across your products; you only pay for results. If you’re new to Google, you can earn up to $500 in ad credits (T&amp;Cs apply). <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">Contact support</a> if you need guidance with Google Listings &amp; Ads.', '{}', 'pending', 'woocommerce.com', '2022-09-23 05:50:48', NULL, 0, 'plain', '', 0, 'info', 0),
(102, 'googlelistings_signals2022_noGLA', 'marketing', 'en_US', 'Show off your products with Ads on Google', 'You’re ready to grow with ads. Google optimizes for performance across your products; you only pay for results. If you’re new to Google, you can earn up to $500 in ad credits (T&amp;Cs apply). <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">Contact support</a> if you need guidance with Google Listings &amp; Ads.', '{}', 'pending', 'woocommerce.com', '2022-09-23 05:50:48', NULL, 0, 'plain', '', 0, 'info', 0),
(103, 'pre-black-friday-sale-2022-announcement', 'marketing', 'en_US', 'Surprise! We’re offering 40% off everything at WooCommerce.com', 'Just in time to get your store Black Friday ready. Sale ends 7 October, 2pm UTC.', '{}', 'unactioned', 'woocommerce.com', '2022-10-04 05:40:36', NULL, 0, 'plain', '', 0, 'info', 0),
(104, 'shipping_category_q4_2022', 'marketing', 'en_US', 'Save time on shipping', 'Is your store all set to ship? Save valuable time (and money!) by automating your fulfillment process for the busiest shopping season. Explore our range of trusted shipping partners to get started.', '{}', 'unactioned', 'woocommerce.com', '2022-10-14 05:47:07', NULL, 0, 'plain', '', 0, 'info', 0),
(105, 'facebook_q4-2022_hasFB', 'marketing', 'en_US', 'Drive more demand this holiday season with Facebook for WooCommerce', 'Deliver a personalized and seamless shopping experience this holiday season with Facebook for WooCommerce. With more ad formats than ever, you can create engaging ads that meet customers across Facebook, Instagram, Messenger, and WhatsApp throughout the busy shopping season.', '{}', 'pending', 'woocommerce.com', '2022-10-21 05:49:12', NULL, 0, 'plain', '', 0, 'info', 0),
(106, 'facebook_q4-2022_noFB', 'marketing', 'en_US', 'Meet your customers where they are with Facebook for WooCommerce', 'Don’t wait for your customers to come to you – meet them where they’re browsing! Use the Facebook for WooCommerce extension to promote your products on Facebook, Instagram, Messenger, and WhatsApp. Create seamless shopping experiences – straight from your WooCommerce dashboard.', '{}', 'unactioned', 'woocommerce.com', '2022-10-22 05:41:11', NULL, 0, 'plain', '', 0, 'info', 0),
(107, 'tiktok-targeted-q4-2022', 'marketing', 'en_US', 'Get $200 in ad credit from TikTok after you spend $20 on your first campaign', 'Reach one billion shoppers with TikTok for WooCommerce this holiday season! Sync your product catalog, capture insights, and create ad campaigns right from your dashboard. Connect your store today to unlock this limited time offer! <a href=\"https://ads.tiktok.com/help/article?aid=10011326\">Terms &amp; conditions apply</a>.', '{}', 'pending', 'woocommerce.com', '2022-10-25 05:50:03', NULL, 0, 'plain', '', 0, 'info', 0),
(108, 'paypal_paylater_g3_q4_22', 'marketing', 'en_US', 'Turn browsers into buyers with Pay Later', 'Add PayPal at checkout, plus give customers a buy now, pay later option from the name they trust. With Pay in 4 &amp; Pay Monthly, available in PayPal Payments, you get paid up front while letting customers spread their payments over time. Boost your average order value and convert more sales – at no extra cost to you.', '{}', 'unactioned', 'woocommerce.com', '2022-11-02 05:39:35', NULL, 0, 'plain', '', 0, 'info', 0),
(109, 'paypal_paylater_g2_q4_22', 'marketing', 'en_US', 'Upgrade to PayPal Payments to offer Pay Later at checkout', 'PayPal Pay Later is included in PayPal Payments at no additional cost to you. Customers can spread their payments over time while you get paid up front. \r\nThere’s never been a better time to upgrade your PayPal plugin. Simply download it and connect with a PayPal Business account.', '{}', 'pending', 'woocommerce.com', '2022-11-04 05:41:00', NULL, 0, 'plain', '', 0, 'info', 0),
(110, 'woocommerce_admin_deprecation_q4_2022', 'info', 'en_US', 'WooCommerce Admin is part of WooCommerce!', 'To make sure your store continues to run smoothly, check that WooCommerce is up-to-date – at least version 6.5 – and then disable the WooCommerce Admin plugin.', '{}', 'pending', 'woocommerce.com', '2022-11-05 05:53:22', NULL, 0, 'plain', '', 0, 'info', 0),
(111, 'google_listings_ads_custom_attribute_mapping_q4_2022', 'marketing', 'en_US', 'Our latest improvement to the Google Listings & Ads extension: Attribute Mapping', 'You spoke, we listened. This new feature enables you to easily upload your products, customize your product attributes in one place, and target shoppers with more relevant ads. Extend how far your ad dollars go with each campaign.', '{}', 'pending', 'woocommerce.com', '2022-12-01 05:42:24', NULL, 0, 'plain', '', 0, 'info', 0),
(112, 'wc-admin-manualauthcapture', 'marketing', 'en_US', 'Miss fewer manual payments in WooCommerce Payments', 'Using WooCommerce Payments to manually authorize and capture payments? We’ve introduced a simplified and more efficient process, so you can miss fewer payments and continue to grow your revenue.', '{}', 'pending', 'woocommerce.com', '2022-12-01 05:42:24', NULL, 0, 'plain', '', 0, 'info', 0);
INSERT INTO `1f9_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`, `is_read`) VALUES
(113, 'apple_pay_square_q422', 'marketing', 'en_US', 'Grow your business with Apple Pay', 'Start boosting your online conversions today with Apple Pay – shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Enable Apple Pay with Square by selecting  Settings &gt; Payments &gt; Square.', '{}', 'pending', 'woocommerce.com', '2022-12-08 05:49:04', NULL, 0, 'plain', '', 0, 'info', 0),
(114, 'apple_pay_wcpay_q422', 'marketing', 'en_US', 'Grow your business with Apple Pay', 'Start boosting your online conversions today with Apple Pay – shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Confirm Apple Pay is enabled by selecting Payments &gt; Settings and making sure Enable express checkouts is checked.', '{}', 'pending', 'woocommerce.com', '2022-12-08 05:49:04', NULL, 0, 'plain', '', 0, 'info', 0),
(115, 'meta-hasFB-dec-q4-2022', 'marketing', 'en_US', 'Power up your Facebook ad strategy', 'Did you know that new privacy policies may be decreasing the effectiveness of your Facebook ads? Get back on track with Meta’s Conversion API. It creates a direct connection between the marketing data from your store and Meta, helping you more accurately track, attribute and improve your Facebook marketing performance.', '{}', 'pending', 'woocommerce.com', '2022-12-10 06:46:28', NULL, 0, 'plain', '', 0, 'info', 0),
(116, 'meta-noFB-dec-q4-2022', 'marketing', 'en_US', 'Create highly targeted Facebook ads with Facebook for WooCommerce', 'Sync your product catalog to create Facebook ads and track their performance – all from within your WooCommerce dashboard. With improved tracking signals and speed, plus more accurate tracking with the introduction of Meta’s Conversion API, you’ll have all the tools you need to run effective ad campaigns.', '{}', 'unactioned', 'woocommerce.com', '2022-12-12 06:48:20', NULL, 0, 'plain', '', 0, 'info', 0),
(117, 'needs-update-eway-payment-gateway-rin-2022-12-20', 'update', 'en_US', 'Security vulnerability patched in WooCommerce Eway Gateway', 'In response to a potential vulnerability identified in WooCommerce Eway Gateway versions 3.1.0 to 3.5.0, we’ve worked to deploy security fixes and have released an updated version.\r\nNo external exploits have been detected, but we recommend you update to your latest supported version 3.1.26, 3.2.3, 3.3.1, 3.4.6, or 3.5.1', '{}', 'pending', 'woocommerce.com', '2023-01-05 06:32:43', NULL, 0, 'plain', '', 0, 'info', 0),
(118, 'updated-eway-payment-gateway-rin-2022-12-20', 'update', 'en_US', 'WooCommerce Eway Gateway has been automatically updated', 'Your store is now running the latest secure version of WooCommerce Eway Gateway. We worked with the WordPress Plugins team to deploy a software update to stores running WooCommerce Eway Gateway (versions 3.1.0 to 3.5.0) in response to a security vulnerability that was discovered.', '{}', 'pending', 'woocommerce.com', '2023-01-05 06:32:43', NULL, 0, 'plain', '', 0, 'info', 0),
(119, 'storeediting_feedback_jan_2023', 'marketing', 'en_US', 'Tell us what you need to customize your store!', 'We need your feedback. Please spare a few minutes to share your input on what is most important to you when designing and customizing your storefront to help us build the features you need.', '{}', 'unactioned', 'woocommerce.com', '2023-01-13 06:03:17', NULL, 0, 'plain', '', 0, 'info', 0),
(120, 'ecomm-wc-navigation-survey-2023', 'info', 'en_US', 'Navigating WooCommerce on WordPress.com', 'We are improving the WooCommerce navigation on WordPress.com and would love your help to make it better! Please share your experience with us in this 2-minute survey.', '{}', 'pending', 'woocommerce.com', '2023-01-17 06:11:31', NULL, 0, 'plain', '', 0, 'info', 0),
(121, 'affirm_q1_2023', 'marketing', 'en_US', 'Turn more browsers into buyers with flexible payments', 'When you offer flexible payment options to shoppers, they\'re more likely to convert. It’s why businesses offering Affirm see an average order value lift of 63%. Affirm tailors your store\'s payment options with terms proven to reach new customers, boost conversions, and grow sales.', '{}', 'unactioned', 'woocommerce.com', '2023-03-13 05:56:04', NULL, 0, 'plain', '', 0, 'info', 0),
(122, 'google_listings_ads_pmax_i1_q1_2023_no_gla', 'marketing', 'en_US', 'Create more engaging ads – without the hard work', 'Get in front of millions of shoppers searching for products like yours with Google Listings &amp; Ads. With new customization features, Google automatically tests multiple combinations of text and images to create the most engaging ad to boost your business. Plus, get up to $500 in ad credit – terms and conditions apply.', '{}', 'unactioned', 'woocommerce.com', '2023-03-16 05:50:22', NULL, 0, 'plain', '', 0, 'info', 0),
(123, 'google_listings_ads_pmax_i1_q1_2023_with_gla', 'marketing', 'en_US', 'New customization features to boost your business', 'You can now add custom images, messaging, and URLs to campaigns in Google Listings &amp; Ads. Google then automatically tests multiple combinations to create the most engaging version to help boost your business. Get more sales with dynamic content – edit an existing campaign or create a new ad now.', '{}', 'pending', 'woocommerce.com', '2023-03-16 05:50:22', NULL, 0, 'plain', '', 0, 'info', 0),
(124, 'woocommerce-wcpay-march-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Payments', '<strong>Your store requires a security update for WooCommerce Payments</strong>. Please update to the latest version of WooCommerce Payments immediately to address a potential vulnerability discovered on March 22. For more information on how to update, visit this WooCommerce Developer Blog Post.', '{}', 'pending', 'woocommerce.com', '2023-03-24 05:47:00', NULL, 0, 'plain', '', 0, 'info', 0),
(125, 'tap_to_pay_iphone_q2_2023_no_wcpay', 'marketing', 'en_US', 'Accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone and WooCommerce Payments is quick, secure, and simple to set up — no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person.', '{}', 'unactioned', 'woocommerce.com', '2023-04-04 05:46:20', NULL, 0, 'plain', '', 0, 'info', 0),
(126, 'tap_to_pay_iphone_q2_2023_with_wcpay', 'marketing', 'en_US', 'New: accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone is quick, secure, and simple to set up in WooCommerce Payments — no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person in a few short steps!', '{}', 'pending', 'woocommerce.com', '2023-04-04 05:46:20', NULL, 0, 'plain', '', 0, 'info', 0),
(127, 'woocommerce-WCPreOrders-april-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Pre-Orders extension', '<strong>Your store requires a security update for the WooCommerce Pre-Orders extension</strong>. Please update the WooCommerce Pre-Orders extension immediately to address a potential vulnerability discovered on April 11.', '{}', 'pending', 'woocommerce.com', '2023-04-15 05:54:05', NULL, 0, 'plain', '', 0, 'info', 0),
