(171, 'tiktok-spc_june-2023', 'marketing', 'en_US', 'Take the guesswork out of TikTok advertising', 'Save time and create smarter ads using new automated campaign management from TikTok for WooCommerce. Simplify your campaign creation and watch TikTok’s machine learning build, target, and optimize ads that support your advertising goals — and grow your audience.', '{}', 'unactioned', 'woocommerce.com', '2023-06-30 05:49:50', NULL, 0, 'plain', '', 0, 'info', 0),
(172, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-07-05 05:52:05', NULL, 0, 'plain', '', 0, 'info', 0),
(173, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-06 05:53:00', NULL, 0, 'plain', '', 0, 'info', 0),
(174, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-12 05:47:05', NULL, 0, 'plain', '', 0, 'info', 0),
